import React from 'react';

import Dropdown from './dropdown.component';

import { SYMBOLS, INTERVALS } from '../assets/constants';

import './radarscreen.styles.css';


const arr = [['SPX', '@ES', '@NQ', 'SPY'],['Daily', 'Daily', '5 Min', 'Hourly'],[3, 6, 8, 0]]

const headerConst = ['Symbol', 'Interval', 'Price']

const selectTbl = {
	Symbol: SYMBOLS,
	Interval: INTERVALS
}

class RadarScreen extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			header: headerConst,
			Symbol: ['SPX', '@ES', '@NQ', 'SPY'],
			Interval: ['Daily', 'Daily', '5 Min', 'Hourly'],
			Price: [3, 6, 8, 0]
		}
	}

	render() {
	let i=0;

	const { header } = this.state;

	// console.log(this.state[header[2]])

	// const prop = header[2];
	// const { [prop]: value } = this.state;

	// console.log(value);


	return(
		<div className="radarscreen">
			<div className='space'></div>

			<div id="grid-container">
				{header.map((value, colIdx) => {

					// this.state[header[colIdx]].map((rowVal,rowIdx) => {
					// 	return (
					// 		console.log(rowVal,rowIdx)
					// 	)
					// })

					i++;
					return (
						<div 
							key={i} 
							id={i} 
							className='header'
							style={{ 
								gridRow: 1,
								gridColumn: colIdx+1}}
						>
							{value}
						</div>
					)
				})
				}

				{
					header.map((value, colIdx) => {
						this.state[value].map((rowVal,rowIdx) => {
							console.log('a',rowVal,rowIdx)
							i++;
							console.log('b',header[colIdx], selectTbl[header[colIdx]],i,rowIdx+2,colIdx+1);
							// header[colIdx] === 'Interval' ? console.log('int') : console.log('ni')
							if(selectTbl[header[colIdx]] !== undefined) {
								console.log('dd1')
								return (
									<Dropdown 
										options={selectTbl[header[colIdx]]}
										defaultValue={selectTbl[header[colIdx]][0]}
										style={{ 
											gridRow: rowIdx+2,
											gridColumn: colIdx+1}}
										key={i} 
										id={i} 
										className='item'
									/> 
								)
							}
							else {
								return (
									<div 
										key={i} 
										id={i} 
										className='item'
										style={{ 
													gridRow: rowIdx+2,
													gridColumn: colIdx+1}}
									>
										{rowVal}
									</div>
								)
							}



						})
					}) 
				}


				{
				arr.map((value, colIdx) => value.map((rowVal,rowIdx) => {
					console.log('c',rowVal,rowIdx)
					i++;
					console.log('d',header[colIdx], selectTbl[header[colIdx]],i,rowIdx+2,colIdx+1);
				// header[colIdx] === 'Interval' ? console.log('int') : console.log('ni')
						if(selectTbl[header[colIdx]] !== undefined) {
							console.log('dd2')
							return (
								// <div className=""></div>
								<Dropdown 
									options={selectTbl[header[colIdx]]}
									defaultValue={selectTbl[header[colIdx]][0]}
									style={{ 
										gridRow: rowIdx+2,
										gridColumn: colIdx+1}}
									key={i} 
									id={i} 
									className='item'
								/> 
							)
						}
						else {
							return (
								<div 
									key={i} 
									id={i} 
									className='item'
									style={{ 
												gridRow: rowIdx+2,
												gridColumn: colIdx+1}}
								>
									{rowVal}
								</div>
							)
						}
					}
					)
				)
				}
			</div>
	</div>
	)
}
}
// }

export default RadarScreen;
